import React, {Component} from 'react';
import './App.css';
import './index.css';
import List from './List'
import Navbartwo from './Navbartwo'
import Footer from './Footer'
import axios from 'axios'


class App extends Component { 
  constructor(props) {
    super(props);
    this.state = {
      pageNo: 1,
      Movies: 24,
    }
  }
  render() {
    return (
      <div style={{ backgroundColor: "#d2d2d275" }}>
        <Navbartwo />
        <List />
        <Footer />
      </div >

    );
  }
}

export default App;
